import { Draggable } from "react-beautiful-dnd";
const Task = ({ task, index }) => {
  console.log("task", index);
  return (
    <>
    <Draggable>{()=>(
           <div className="cs">{task.content}</div>
   
    )}</Draggable>
    </>
  );
};
export default Task;
